content:
저기 가족은 다 제정신이 아닌가 아니면 저 쌤이 뭐했나 왜저래;;;
&quot;아빠 저런사람은 뭐야?&quot;
&quot;어, 미친사람들이야&quot;
&quot;저런사람들은 어떻게해?&quot;
&quot;반 죽이던가 신고해야돼&quot;
&quot;알겠어!&quot;
실제로 저런애가 있거나 저런 부모들은 바로 신고..해야됄거 같아요

아...처음엔 엄마보고 왜 아들 정신병원 치료 안받게하지??
이렇게 생각들었는데 다시 생각해보니까 그럼 아빠가
가만히 안있었겠네;;정신병소리듣고 난리쳤을듯;;

애 급발진해서 난리치는 거 보면 애아빠 닮아서 그런 것 같은데
애아빠가 보고 아이고ㅠ 우리애가 잘못했던 거네요.. 죄송합니다
안하고 오히려 개 난리 칠 듯;;; 애한테 무슨짓을 했는데 조용한 애가 이렇게 해요! 이런식으로;

와.. 애비라는 작자는 영상 보고도 아무 생각이 없는건가?
자기 아들이 저런 난폭성을 가졌다는 거와,
자기 마누라 머리카락을 자른 그 사건도 알면서;
왜 쳐울면서 아들 편을 드는거지..?????????????;;
그럼 자기 마누라는 아들을 무서워했단것도 알고 있었겠네?
그 누구보다 우빈이새771가 정신병자인거도 알고 있었을테고? 단지 자기 아들이라 불쌍하다고, 쳐 감싸려는 저 행동이 너무 엿같다 ;.. 욕이 절로나오네 ㅋㅋㅋㅋㅋ

&quot;좋아합니다&quot;
? 난 이런만 못들어 봤는ㄷ..
모솔인ㄷ... 하..

아니 뭐 동생한테 컴플렉스 있어?
그냥 자기 자식 미래에 선생만날거 미리 걱정하는 걸 넘어서는 수준으로 동생은
힘든거 모르쇠하고 당연히 잘못했을 거라고 여기면서 남의 애편만 드네 허참;

처음 연재와 사장놈을 보며  저 쓰레기.지조없는 놈. 별욕을 다하며봤는데.현실에도 저런놈이있다면 명치치고싶네요ㅡ.ㅡ
마지막 정리되서 그나마 참을수있었어요
마지막 새드엔딩이라 ... 가슴이 먹먹;;

아주 쪼금만 따끔합니다^^
대신 가족에게 마지막 말슴을.....
&quot;녜?&quot;

근데 중인들도 망건에 관자있는거보니 딱히 그럴꺼같진않네;
관자란게 1~3품 당상관들만 쓰던거였거든
품별로 재질 모양도 다 달랐고

미파는 머리 좀 바꿨을 뿐인데 여장이 되다니;;;
심지어 개취로 좀 예쁜데ㅋㅋㅋㅋㅋ
이걸로 미파는 작가님 공식 인증 미인인가요?

하ㅜㅜ진짜 이 작품 정말 재밌어요 완전 제스타일
거기다가 역사 잘아시는 분들이 댓글 달아주는 거 읽는 재미까지!!!!!! 저 댓글 거의 안 다는데 너무 재밌어서 댓글 달아요
홍보 많이 해야겠어요ㅋㅋㅋ  천년만년 연재해주세요&gt;.&lt;

이제서야 주인공들 이름이 도레미파솔라시도 음계라는걸 알았다 ;;;;;;
올림 내림 은 샵 플랫이고 온은 온음표
앞으론 반음이 팔분이 사분이 등등이 등장하려나
